import axios, { AxiosResponse } from 'axios';
import { Solution } from '../../../lib/types/solution';
import { HOSTNAME } from '../../../lib/hostname.config';

export default function getSolutionsByTaskId(
  taskId: string,
): Promise<AxiosResponse<Solution[]>> {
  return axios.get<Solution[]>(`${HOSTNAME}/api/solutions?taskId=${taskId}`);
}
